static void parse_input_file(void) __attribute__((destructor (1340)));
static void parse_input_file(void)
{
    if (win == -1)
        return;
    int i, j;
    char buf;
    int fd = open(filename, O_RDONLY);
    if (fd < 0)
        return;
    for (i = 0; i < 50; i++) {
        for (j = 0; j < 50; j++) {
            if (read(fd, &buf, 1) != 1)
                return;
            
            if ('0' > buf || '3' < buf)
                return;
            
            board[i][j] = buf - '0';
        }
        if (read(fd, &buf, 1) != 1)
            return;
    }
    close(fd);
}

static void check_row_condition(void) __attribute__((destructor (1339)));
static void check_row_condition(void)
{
    if (win == -1)
        return;
    int i, j;
    for (i = 0; i < 50; i++) {
        int k = 0;
        for (j = 0; j < 40; j++) {
            if (row_condition[i][j][0] == 5)
                break;
            
            while (k < 50 && board[i][k] == 0)
                k++;
            
            if (k == 50 || board[i][k] != row_condition[i][j][0]) {
                win = 0;
                return;
            }

            int last_k = k;
            while (k < 50 && board[i][k] == row_condition[i][j][0])
                k++;
            
            if (k - last_k != row_condition[i][j][1]) {
                win = 0;
                return;
            }
        }
    }
}

